import React, { Component } from 'react';
import Controler from "../staticFiles/xbox.png"
class ConnectController extends Component {
    state = {  }
    style={
        width:'100vw',
        height:'100vh',
        zindex:1,
        backgroundColor:'white',
        position:'abosulte',
        top:'0',
        left:'0',
        margin:'auto'
    }
    img={
        marginLeft:'25%',
        width:'50%'
    }
    render() { 
        return ( <div style={this.style}>
            <img style={this.img} src={Controler}></img>
            <h3 style={img}>Please connect a controller</h3>
        </div> );
    }
}

export default ConnectController;
